exports=async function(bid,options){const{parseCatalog,cleanDescendingNewest}=await require("transcode/parse_catalog");return parseCatalog(`https://www.ksxsw.org/${bid.idPrefix()}/${bid}/`,"div#list>dl>dd",{...options,clientOptions:{...(options&&options.clientOptions),encoding:"gbk"}}).then(_=>cleanDescendingNewest(_))};